import React from 'react';
import Preloader from './../assets/Preloader.svg'

const ScoreBoard = (props) => {
    let board;
    console.log(board);
    if (!props.scorePoints) {
        board = props.scorePoints.map((e, i) => <ScoreItem key={i} amount={e} />);
        console.log(board);
        return board;
    };
    console.log(board);
    return (
        <div>
            {board}
        </div>
    )
}

const ScoreItem = (props) => {
    return (
        <div>
            {props.amount}
        </div>
    )
}

export default ScoreBoard;
